afef-c5c0-11e1-a6f7-22000af841b1'),(1022,1025,'Type of leukocyte, with coarse granules that stain blue when exposed to a basic dye. Basophils normally constitute 1% or less of the total white blood cell count but may increase or decrease in certain diseases.','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667b410-c5c0-11e1-a6f7-22000af841b1'),(1023,1026,'Describes the relative distribution of the different types of white blood cells','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667b4ed-c5c0-11e1-a6f7-22000af841b1'),(1024,1027,'Percentage of T-Suppresor (killer) lymphocytes','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667b594-c5c0-11e1-a6f7-22000af841b1'),(1025,1028,'Count of t-cells which express the CD3 surface receptor','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667b63b-c5c0-11e1-a6f7-22000af841b1'),(1026,1029,'Titre level of VDRL test.','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667b6dd-c5c0-11e1-a6f7-22000af841b1'),(1027,1030,'Qualitiative test to determine HIV infection','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667b782-c5c0-11e1-a6f7-22000af841b1'),(1028,1031,'A treponemal antigen serologic test for syphilis using tanned sheep red blood cells coated with antigen from the Nichol\'s strain of Treponema pallidum and patient serum absorbed with an extract of Reiter treponemes to remove nonspecific antibodies. It is similar in sensitivity and specificity to the FTA-ABS test except that it is less sensitive in detecting primary syphilis.','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667b825-c5c0-11e1-a6f7-22000af841b1'),(1029,1032,'Qualitative interpretation of TPHA result.','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667bc3d-c5c0-11e1-a6f7-22000af841b1'),(1030,1033,'Test to detect chlamydial infections via PCR','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667bcee-c5c0-11e1-a6f7-22000af841b1'),(1031,1034,'Qualitative test to detect chlamydia infections via PCR','en',1,'2004-12-02 00:00:00',NULL,NULL,'e667be4e-c5c0-11e1-a6f7-22000af841b1'),(1032,1035,'Quantitative measure of Herpes Simplex Virus