iptive term:  open to two or more interpretations; or of uncertain nature or significance.','en',1,'2006-06-05 00:00:00',NULL,NULL,'e668f101-c5c0-11e1-a6f7-22000af841b1'),(1295,1301,'Descriptive term:  to discover or ascertain the existence, presence, or fact of.','en',1,'2006-06-05 00:00:00',NULL,NULL,'e668f717-c5c0-11e1-a6f7-22000af841b1'),(1296,1302,'Descriptive term:  unable to discover or ascertain the existence, presence, or fact of.','en',1,'2006-06-05 00:00:00',NULL,NULL,'e668fadb-c5c0-11e1-a6f7-22000af841b1'),(1297,1303,'Descriptive term:  restrictive of action.','en',1,'2006-06-05 00:00:00',NULL,NULL,'e668fb9c-c5c0-11e1-a6f7-22000af841b1'),(1298,1305,'This is a qualitative result for the number of copies/ml of DNA/RNA in patients with HIV.','en',1,'2006-06-05 00:00:00',NULL,NULL,'e668fc40-c5c0-11e1-a6f7-22000af841b1'),(1299,1306,'Descriptive Term:  beyond detectable limit.','en',1,'2006-06-05 00:00:00',NULL,NULL,'e668fd28-c5c0-11e1-a6f7-22000af841b1'),(1300,1307,'Mean platelet volume (MPV) is a machine-calculated measurement of the average size of your platelets. New platelets are larger, and an increased MPV occurs when increased numbers of platelets are being produced. MPV gives your doctor information about platelet production in your bone marrow.','en',1,'2006-06-06 00:00:00',NULL,NULL,'e668fdd8-c5c0-11e1-a6f7-22000af841b1'),(1301,1308,'A measurement derived from the platelet count and the mean platelet volume.','en',1,'2006-06-06 00:00:00',NULL,NULL,'e668fe8c-c5c0-11e1-a6f7-22000af841b1'),(1302,1309,'Derived from direct flow cytometric measurement of platelet cell volume, it is increased in the presence of platelet anisocytosis.','en',1,'2006-06-06 00:00:00',NULL,NULL,'e668ff3b-c5c0-11e1-a6f7-22000af841b1'),(1303,1310,'Percentage of t-cells which express the CD3 surface receptor.','en',1,'2006-06-06 00:00:00',NULL,NULL,'e668ffe8-c5c0-11e1-a6f7-22000af841b1'),(1304,1318,'Quantitative cut-off result for initial HIV screening test','en',1,'2006-06-06 00:00:00',NULL,NULL,'e6690092-c5c0-11e1-a6f7-22000af841b1'),(1305,1319,'Immunology Test - CD45 plus lymphocyte count.','en',1,'2006-06-06 00:00:00',NULL,NULL,'e6690138-c5c0-11e1-a6f7-22000af841b1'),(1306,1326,'Qualitative interpretation of rapid HIV screening test 2.','en',1,'2006-06-07 00:00:00',NULL,NULL,'e66901e4-c5c0-11e1-a6f7-22000af841b1'),(1307,1327,'Help determine if the bone marrow is responding adequately to the body?s need for RBCs and to help determine the cause of and classify different types of anemia.\r\n\r\nReticulocyte (%) = [Number of Reticulocytes / Number of Red Blood Cells] X 100','en',1,'2006-06-09 00:00:00',NULL,NULL,'e669028c-c5c0-11e1-a6f7-22000af841b1'),(1308,1328,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ','en',1,'2006-06-09 00:00:00',NULL,NULL,'e669033d-c5c0-11e1-a6f7-22000af841b1'),(1309,1330,'Absolute neutrophil count (ANC) is a measure of the number of neutrophil granulocytes (also known as polymorphonuclear cells, PMN\'s, polys, granulocytes, segmented neutrophils or segs) present in the blood. Neutrophils are a type of white blood cell that fights against infection.\r\n\r\nANC = (%neutrophils + %bands) x WBC','en',1,'2006-06-09 00:00:00',NULL,NULL,'e66903ea-c5c0-11e1-a6f7-22000af841b1'),(1310,1331,'A monocyte count is part of a complete blood count and is expressed by absolute numbers.  Increase a monocyte count include: - chronic inflammation - stress response - hyperadrenocorticism - immune mediated disease - pyogranulomatous disease - necrosis - red cell regeneration.\r\n','en',1,'2006-06-09 00:00:00',NULL,NULL,'e66904a1-c5c0-11e1-a6f7-22000af841b1'),(1311,1332,'Eosinophil granulocytes, commonly referred to as eosinophils (or less commonly as acidophils), are white blood cells that are responsible for combating infection by parasites in the body.\r\n\r\n','en',1,'2006-06-09 00:00:00',NULL,NULL,'e66905ea-c5c0-11e1-a6f7-22000af841b1'),(1312,1333,'Basophils are the least common of the granulocytes, representing about 0.5% to 1% of circulating leukocytes. ','en',1,'2006-06-09 00:00:00',NULL,NULL,'e66906b5-c5c0-11e1-a6f7-22000af841b1'),(1313,1334,'Reactive, or atypical lymphocytes are lymphocytes that become large as a result of antigen stimulation. Typically they can be more than 30 ','en',1,'2006-06-09 00:00:00',NULL,NULL,'e669076e-c5c0-11e1-a6f7-22000af841b1'),(1314,1336,'Type of white blood cell which forms an early line of defence against bacterial infections by using microscopic exam','en',1,'2006-06-09 00:00:00',NULL,NULL,'e669081b-c5c0-11e1-a6f7-22000af841b1'),(1315,1337,'Immature neutrophils with a crescent shaped nucleus, bands are normal in the circulation in small numbers. If there is a percentage increase of them, there is said to be a left shift. This may happen when an acute infection stimulates increased neutrophils production.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'e66908c7-c5c0-11e1-a6f7-22000af841b1'),(1316,1338,'Agranulocytic leukocyte that normally makes up about 25% of the total white blood cell count but increases in the presence of infection.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'e6690979-c5c0-11e1-a6f7-22000af841b1'),(1317,1339,'Large, circulating, phagocytic white blood cells, having a single well-defined nucleus and very fine granulation in the cytoplasm. Monocytes constitute from 3 to 8 percent of the white blood cells in humans.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'e6690a2b-c5c0-11e1-a6f7-22000af841b1'),(1318,1340,'A type of white blood cell found in vertebrate blood, containing cytoplasmic granules that are easily stained by eosin or other acid dyes.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'e6690ae0-c5c0-11e1-a6f7-22000af841b1'),(1319,1341,'Type of leukocyte, with coarse granules that stain blue when exposed to a basic dye. Basophils normally constitute 1% or less of the total white blood cell count but may increase or decrease in certain diseases.  This is a microscopic exam.','en',1,'2006-06-09 00:00:00',NULL,NULL,'e6690b9d-c5c0-11e1-a6f7-22000af841b1'),(1320,1342,'Body Mass Index (BMI) is a relationship between weight and height that is associated with body fat and health risk.\r\n\r\nThe equation is BMI = body weight in kilograms/height in meters squared.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e6690cab-c5c0-11e1-a6f7-22000af841b1'),(1321,1343,'MUAC is the circumference of the left upper arm, measured at the mid-point between the tip of the shoulder and the tip of the elbow.  MUAC is useful for the assessment of nutritional status.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e6690df3-c5c0-11e1-a6f7-22000af841b1'),(1322,1344,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e6690eff-c5c0-11e1-a6f7-22000af841b1'),(1323,1345,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e6691003-c5c0-11e1-a6f7-22000af841b1'),(1324,1346,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e669110b-c5c0-11e1-a6f7-22000af841b1'),(1325,1347,'Anatomic location.\r\n','en',1,'2006-07-13 00:00:00',NULL,NULL,'e669120f-c5c0-11e1-a6f7-22000af841b1'),(1326,1348,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e6691314-c5c0-11e1-a6f7-22000af841b1'),(1327,1349,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e6691411-c5c0-11e1-a6f7-22000af841b1'),(1328,1350,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e669150e-c5c0-11e1-a6f7-22000af841b1'),(1329,1351,'Anatomic location.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e6691610-c5c0-11e1-a6f7-22000af841b1'),(1330,1352,'Estimation of body fat by skinfold thickness measurement.','en',1,'2006-07-13 00:00:00',NULL,NULL,'e669170d-c5c0-11e1-a6f7-22000af841b1'),(1331,5002,'Describes a person\'s cause of death.. Coded answer.','en',1,'2004-08-12 00:00:00',NULL,NULL,'e669180d-c5c0-11e1-a6f7-22000af841b1'),(1332,5003,'Patient\'s identifica