es allowed for use on system','e6e16642-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('location.field.style','default','Type of widget to use for location fields','db993b5e-7097-4a23-8b4e-d4aabf9b5846',NULL,NULL,NULL,NULL),('log.level','info','log level used by the logger \'org.openmrs\'. This value will override the log4j.xml value. Valid values are trace, debug, info, warn, error or fatal','e6e166e3-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('logic.default.ruleClassDirectory','logic/class','Default folder where compiled rule will be stored','1135a983-a561-4f67-a670-a56bbe3b60e2',NULL,NULL,NULL,NULL),('logic.default.ruleJavaDirectory','logic/sources','Default folder where rule\'s java file will be stored','03e765d2-d531-40bc-8fca-16cdc8ecf819',NULL,NULL,NULL,NULL),('logic.defaultTokens.conceptClasses',NULL,'When registering default tokens for logic, if you specify a comma-separated list of concept class names here, only concepts of those classes will have tokens registered. If you leave this blank, all classes will have tokens registered for their concepts.','3088ca17-3a5c-4511-b5f2-a8678f2a7894',NULL,NULL,NULL,NULL),('logic.mandatory','false','true/false whether or not the logic module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','29defe7c-75a8-4ac7-b1c7-dd0822ce86b1',NULL,NULL,NULL,NULL),('logic.started','true','DO NOT MODIFY. true/false whether or not the logic module has been started.  This is used to make sure modules that were running  prior to a restart are started again','8e0f5aa8-3800-42a0-823b-eedcb294ac44',NULL,NULL,NULL,NULL),('mail.debug','false','true/false whether to print debugging information during mailing','e6e16787-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('mail.default_content_type','text/plain','Content type to append to the mail messages','e6e16827-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('mail.from','info@openmrs.org','Email