IdentifierValidator','This property sets the default patient identifier validator.  The default validator is only used in a handful of (mostly legacy) instances.  For example, it\'s used to generate the isValidCheckDigit calculated column and to append the string \"(default)\" to the name of the default validator on the editPatientIdentifierType form.','e6e1701e-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('patient.displayAttributeTypes','Birthplace',NULL,'e6e17249-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('patient.headerAttributeTypes',NULL,'A comma delimited list of PersonAttributeType names that will be shown on the patient dashboard','184e1eea-e7cf-4432-9cca-3b8bf5c037b5',NULL,NULL,NULL,NULL),('patient.identifierPrefix','','This property is only used if patient.identifierRegex is empty.  The string here is prepended to the sql indentifier search string.  The sql becomes \"... where identifier like \'<PREFIX><QUERY STRING><SUFFIX>\';\".  Typically this value is either a percent sign (%) or empty.','e6e1730b-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('patient.identifierRegex','','WARNING: Using this search property can cause a drop in mysql performance with large patient sets.  A MySQL regular expression for the patient identifier search strings.  The @SEARCH@ string is replaced at runtime with the user\'s search string.  An empty regex will cause a simply \'like\' sql search to be used. Example: ^0*@SEARCH@([A-Z]+-[0-9])?$','e6e173bf-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('patient.identifierSearchPattern',NULL,'If this is empty, the regex or suffix/prefix search is used.  Comma separated list of identifiers to check.  Allows for faster searching of multiple options rather than the slow regex. e.g. @SEARCH@,0@SEARCH@,@SEARCH-1@-@CHECKDIGIT@,0@SEARCH-1@-@CHECKDIGIT@ would turn a request for \"4127\" into a search for \"in (\'4127\',\'04127\',\'412-7\',\'0412-7\')\"','eac6aec7-e2f8-40ae-b617-886ae8d56ae7',NULL,NULL,NULL,NULL),('patient.identifierSuffix','','This property is only used if patient.identifierRegex is empty.  The string here is prepended to the sql indentifier search string.  The sql becomes \"... where identifier like \'<PREFIX><QUERY STRING><SUFFIX>\';\".  Typically this value is either a percent sign (%) or empty.','e6e1747c-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('patient.listingAttributeTypes','','A comma delimited list of PersonAttributeType names that should be displayed for patients in _lists_','e6e17539-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('patient.nameValidationRegex','^[a-zA-Z \\-]+$','Names of the patients must pass this regex. Eg : ^[a-zA-Z \\-]+$ contains only english alphabet letters, spaces, and hyphens. A value of .* or the empty string means no validation is done.','492dac2d-145e-412e-9c56-4d7d40b306ec',NULL,NULL,NULL,NULL),('patient.viewingAttributeTypes','','A comma delimited list of PersonAttributeType names that should be displayed for patients when _viewing individually_','e6e1769a-c5c0-11e1-a6f7-22000af841b1',NULL,NULL,NULL,NULL),('patientflags.database_version','1.2.10','DO NOT MODIFY.  Current database version number for the patientflags module.','724a7ecf-32d9-451b-855a-dc81a4064502',NULL,NULL,NULL,NULL),('patientflags.mandatory','false','true/false whether or not the patientflags module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','1eeb782f-b669-4594-af00-617f4111c4f8',NULL,NULL,NULL,NULL),('patientflags.patientHeaderDisplay','true','DO NOT MODIFY HERE: use \"manage flag global properties\" to modify; true/false whether or not to display flags in the Patient Dashboard overview','ae148dc6-d2a7-4e26-87aa-639b8a55c284',NULL,NULL,NULL,NULL),('patientflags.patientOverviewDisplay','true','DO NOT MODIFY HERE: use \"manage flag global properties\" to modify; true/false whether or not to display flags in the Patient Dashboard header','405effdf-52fa-47a