vityTask','2006-04-24 00:00:00',NULL,60,0,0,1,'2006-04-24 00:00:00',NULL,NULL,NULL,'0da17b33-c5c1-11e1-a6f7-22000af841b1'),(8,'Update Concept Words','Iterates through the concept dictionary, re-creating concept words (which are used for searcing). This task is started when using the \"Update Concept Word Storage\" page and no range is given.','org.openmrs.scheduler.tasks.ConceptWordUpdateTask',NULL,NULL,0,0,0,1,'2008-11-11 00:00:00',1,'2008-11-11 00:00:00',NULL,'0da17c27-c5c1-11e1-a6f7-22000af841b1'),(9,'Auto Close Visits Task','Stops all active visits that match the visit type(s) specified by the value of the global property \'autoCloseVisits.visitType\'','org.openmrs.scheduler.tasks.AutoCloseVisitsTask','2011-11-28 23:59:59','MM/dd/yyyy HH:mm:ss',86400,0,0,1,'2012-07-04 10:15:02',NULL,NULL,NULL,'8c17b376-1a2b-11e1-a51a-00248140a5eb'),(10,'Initialize Logic Rule Providers',NULL,'org.openmrs.logic.task.InitializeLogicRuleProvidersTask','2012-07-04 10:16:05',NULL,1999999999,0,1,2,'2012-07-04 10:15:35',2,'2012-07-04 10:16:17','2012-07-04 10:16:17','da0e3afa-d883-47fb-9b98-fb0502610b3f');
